import React from 'react';
import './App.css';
import './index.css'

function App() {
  return (
    <>
      <header className='navbar-header'>
        <nav className='navbar-nav'>
          <li className='navbar-li'>
            Idle-Game
            </li>
          <ul className='navbar-ul'>

            <li className='navbar-li'>
              Login
            </li>
            <li className='navbar-li' >
              Register
            </li> 
          </ul>
        </nav>
      </header>
    </>
  );
}

export default App;
